import React from 'react';
import { ClockIcon, MapPinIcon, UserIcon, CurrencyRupeeIcon } from '@heroicons/react/24/outline';

const statusColors = {
  pending: 'bg-yellow-100 text-yellow-800',
  accepted: 'bg-blue-100 text-blue-800',
  'in-progress': 'bg-purple-100 text-purple-800',
  completed: 'bg-green-100 text-green-800',
  cancelled: 'bg-red-100 text-red-800'
};

const BookingCard = ({ booking, onAccept, onReject, onStatusUpdate }) => {
  const handleAccept = () => onAccept?.(booking._id);
  const handleReject = () => onReject?.(booking._id);
  const handleStatusUpdate = (status) => onStatusUpdate?.(booking._id, status);

  return (
    <div className="bg-white rounded-lg shadow-md overflow-hidden border border-gray-200 hover:shadow-lg transition-shadow">
      <div className="p-4">
        <div className="flex justify-between items-start">
          <div>
            <h3 className="text-lg font-medium text-gray-900">
              {booking.service?.name || 'Service Booking'}
            </h3>
            <p className="text-sm text-gray-500 mt-1">
              #{booking.bookingId || booking._id?.slice(-6)}
            </p>
          </div>
          <span className={`px-2 py-1 rounded-full text-xs font-medium ${statusColors[booking.status] || 'bg-gray-100 text-gray-800'}`}>
            {booking.status?.replace('-', ' ')}
          </span>
        </div>

        <div className="mt-3 space-y-2">
          <div className="flex items-center text-sm text-gray-600">
            <UserIcon className="h-4 w-4 mr-2 text-gray-400" />
            <span>{booking.customer?.name || 'Customer'}</span>
          </div>
          <div className="flex items-center text-sm text-gray-600">
            <MapPinIcon className="h-4 w-4 mr-2 text-gray-400" />
            <span className="truncate">{booking.address || 'No address provided'}</span>
          </div>
          <div className="flex items-center text-sm text-gray-600">
            <ClockIcon className="h-4 w-4 mr-2 text-gray-400" />
            <span>
              {new Date(booking.scheduledAt || booking.createdAt).toLocaleString()}
            </span>
          </div>
          {booking.pricing?.totalAmount && (
            <div className="flex items-center text-sm text-gray-600">
              <CurrencyRupeeIcon className="h-4 w-4 mr-2 text-gray-400" />
              <span className="font-medium">â‚¹{booking.pricing.totalAmount.toLocaleString()}</span>
            </div>
          )}
        </div>

        <div className="mt-4 flex space-x-2">
          {booking.status === 'pending' && (
            <>
              <button
                onClick={handleAccept}
                className="flex-1 bg-green-600 hover:bg-green-700 text-white px-3 py-2 rounded-md text-sm font-medium"
              >
                Accept
              </button>
              <button
                onClick={handleReject}
                className="flex-1 bg-red-600 hover:bg-red-700 text-white px-3 py-2 rounded-md text-sm font-medium"
              >
                Reject
              </button>
            </>
          )}
          {booking.status === 'accepted' && (
            <button
              onClick={() => handleStatusUpdate('in-progress')}
              className="w-full bg-blue-600 hover:bg-blue-700 text-white px-3 py-2 rounded-md text-sm font-medium"
            >
              Start Service
            </button>
          )}
          {booking.status === 'in-progress' && (
            <button
              onClick={() => handleStatusUpdate('completed')}
              className="w-full bg-purple-600 hover:bg-purple-700 text-white px-3 py-2 rounded-md text-sm font-medium"
            >
              Complete Service
            </button>
          )}
        </div>
      </div>
    </div>
  );
};

export default BookingCard;
